import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import RestorantCreate from './components/RestorantCreate';
import RestorantUpdate from './components/RestorantUpdate';
import RestorantDelete from './components/RestorantDelete';
import RestorantDetail from './components/RestorantDetail';
import RestorantList from './components/RestorantList';
import RestorantSearch from './components/RestorantSearch';
import Home from './components/Home';
import Login from './components/Login';
import CustomNavbar from './components/Navbar';

function App() {
  return (
    <div className="App">
      <CustomNavbar />
      <Router>
        <Route exact path='/'>
          <Home />
        </Route>
        <Route path='/create'>
          <RestorantCreate />
        </Route>
        <Route path='/update/:id' 
        render={(props)=>(<RestorantUpdate {...props} />)}>
        </Route>
        <Route path='/login/' 
        render={(props)=>(<Login {...props} />)}>
        </Route>
        <Route path='/list'>
          <RestorantList />
        </Route>
        <Route path='/detail'>
          <RestorantDetail />
        </Route>
        <Route path='/search'>
          <RestorantSearch />
        </Route>
        <Route path='/delete'>
          <RestorantDelete />
        </Route>
      </Router>
    </div>
  );
}

export default App;
